Arena - sausakimša Kad kauniečiai myli SEL ir Egį įrodo faktas, kad būtent „Žalgirio“ arenoje prieš kelerius metus grupė surinko rekordinę minią fanų. Skaičiuojama, kad 2014 metais koncertą Kaune stebėjo apie 22 tūkst. SEL gerbėjų. Panaši apgultis buvo ir šiemet. Tiesa, dėl scenos pastatymo techninių sprendimų pats SEL pranešė, kad koncertą maksimaliai galės stebėti apie 15 tūkst. žmonių. Rekordiniais metais scena buvo sumontuota arenos viduryje, o šį kartą tradiciškai, arenos priekyje. Būtent dėl to sumažėjo maksimalus galimas žiūrovų skaičius. Scenoje su robotu „Stojam SEL fanai! Stojam! Stojam! Aukščiau rankas! Telefonai į šoną, rankos į viršų“, – nuo scenos minią užvedinėjo Egis. Jau pačioje koncerto, kuris vėlavo apie pusvalandį, pradžioje scenoje pasirodė ir dvimetrinis titaninis robotas, kuris lėtai judėjo pagal muzikos ritmus. Pirmus kūrinius SEL'as atliko su scenos partnere Camille, kuri taip pat pasipuošusi įspūdingu šviečiančiu kostiumu. „Kaip jūsų nuotaika? Mano gera – šiandien uždirbau daug pinigų. Kitą dainą skiriu visoms grupuotėms – daškiniams, daktarams, gaidjurgiams... Taip pat konservatoriams, komunistams ir kitiems pederastams“, – nuo scenos žėrė Egis. Koncerto pradžioje skambėjo kiek mažiau populiarūs SEL hitai. „Visko užtenka? Kažkaip sunkokai kol kas. Na, tai kai ką geriau žinomo“, - kalbėjo E. Dragūnas, o scenoje nuskambėjo hito „Parašyk man laišką iš Paryžiaus“ akordai. Koncertui įsibėgėjant įsišėlo ir žiūrovai. Ant kojų „Žalgirio“ areną pakėlė hitai „Nes aš tik vėjas“ ir „Užmerkiu akis“. „Ar ne per garsiai? Dainuojame visi kartu! Mano meile dėl tavęs, aš perplauksiu visas upes...“, - puikiai žinomą Gintarės Karaliūnaitės kūrinį uždainavo SEL'as. „Šiandien turėčiau gerti šampaną, bet man nereikia, nes aš turiu gerą paną. Ir man nereikia, alkoholio, kad gyvenimas atrodytų gražesnis. Bet aš vistiek šiandien prisigersiu“, - kalbėjo Egis. Tuomet pasigirdo hitas „Muzika“, o E. Dragūnas ant publikos šliūkštelėjo vandens iš buteliuko. (function(d, 